import React from "react";
import ReactDOM from "react-dom";
import "./index.css";
import App from "./App";
import { BrowserRouter } from "react-router-dom";

const dialogs = [
    { id: 1, name: "Alex" },
    { id: 2, name: "Igor" },
    { id: 3, name: "Leha" },
    { id: 4, name: "Gleb" },
];

const messages = [
    { id: 1, message: "Hi" },
    { id: 2, message: "Hi Hi how are you?" },
    { id: 3, message: "Hi Hi Hi" },
];

const posts = [
    { id: 1, message: "Hello, how you doin?", likesCount: 12 },
    { id: 2, message: "Hi, great, thanx", likesCount: 10 },
];

const addPost = (postMessage:string) => {
    const newPost = { id: 5, message: postMessage, likesCount: 0 };
    // Add your logic for adding a new post here
   posts.push(newPost)
};

ReactDOM.render(
    <BrowserRouter>
        <App
            dialogs={dialogs}
            messages={messages}
            posts={posts}
            addPost={addPost}
        />
    </BrowserRouter>,
    document.getElementById("root")
);
